import React, { useState } from "react";

import '../CSS/Login.scss';

const Login = () => {

  return (
    <>
      <div className="login_container">
        <div className="login">
          <div className="login_box">
            Login

          </div>
        </div>
        <div className="signup_btn_container">
          Signup
        </div>
      </div>
    </>
  )
};


export default Login;
